sys_variable_value.value:
(function execute(inputs, outputs) {
  var futureDateTime = new ImportSetUtilsSNC().getFutureDateTime();
  outputs.future_date = new ImportSetUtilsSNC().getConvertedDate(futureDateTime);
  outputs.future_date_time = new ImportSetUtilsSNC().getConvertedDateTime(futureDateTime);
})(inputs, outputs);

